        //console.log('Use Eddfect');
        //document.title = 'Cambiamos el titulo';
        obtenerDatos()
        
    },[]);
    //Llamado a la api
    const obtenerDatos = async() => {
        const data = await fetch('https://jsonplaceholder.typicode.com/users')
        const users = await data.json()//tenemos la info a JSON
        //console.log(users)
        setEquipo(users)
    }

    return(
        <div>
            <h1>Hola</h1>
        </div>
    );
}
